/* Trigger structure for table `ausentismo_historial_ausentismos` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `trigger_Insert_Ausentismo_Historial_Ausentismos_Certificados` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'%' */ /*!50003 TRIGGER `trigger_Insert_Ausentismo_Historial_Ausentismos_Certificados` BEFORE INSERT ON `ausentismo_historial_ausentismos` FOR EACH ROW BEGIN
		INSERT INTO ausentismo_historial_ausentismos_archivos 
			(id_persona, 
			id_motivo, 
			fecha_desde, 
			fecha_hasta, 
			nombre_archivo, 
			tamano_archivo, 
			fecha_insert, 
			binaryvalue
			)
			VALUES
			(new.id_persona, 
			new.id_motivo, 
			new.fecha_desde, 
			new.fecha_hasta, 
			'', 
			'', 
			NOW(), 
			''
			);
    END */$$


DELIMITER ;

/* Trigger structure for table `ausentismo_historial_ausentismos` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `trigger_Update_ausentismo_periodos` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'%' */ /*!50003 TRIGGER `trigger_Update_ausentismo_periodos` AFTER INSERT ON `ausentismo_historial_ausentismos` FOR EACH ROW BEGIN
	UPDATE f33.ausentismo_periodos 
	SET
	cantidad_dias_disponibles = cantidad_dias_disponibles - NEW.cantidad_dias
	WHERE
	         id_persona = NEW.id_persona
	     AND id_motivo =  NEW.id_motivo 
	     AND periodo_desde =  NEW.fecha_desde_periodo
	     AND periodo_hasta =  NEW.fecha_hasta_periodo ;
    END */$$


DELIMITER ;

/* Trigger structure for table `filial_personas` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `trigger_Update_Filial_Personas` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'%' */ /*!50003 TRIGGER `trigger_Update_Filial_Personas` AFTER UPDATE ON `filial_personas` FOR EACH ROW BEGIN
	UPDATE sec_users 
		SET
		NAME = NEW.apellido_nombre_persona, 
		email = NEW.correo_electronico,
		active = if(NEW.estado_persona = 1, 'Y', 'N')
		WHERE
		login = NEW.id_persona ;
    END */$$


DELIMITER ;

/* Trigger structure for table `filial_personas` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `trigger_Delete_Filial_Personas` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'%' */ /*!50003 TRIGGER `trigger_Delete_Filial_Personas` AFTER DELETE ON `filial_personas` FOR EACH ROW BEGIN
	UPDATE sec_users 
		SET 
		active = 'N' 
		WHERE
		login = OLD.id_persona ;
    END */$$


DELIMITER ;

/* Trigger structure for table `sec_users` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `trigger_Insert_Filial_Personas` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'%' */ /*!50003 TRIGGER `trigger_Insert_Filial_Personas` AFTER INSERT ON `sec_users` FOR EACH ROW BEGIN
	INSERT INTO sec_users 
		(login, 
		pswd, 
		NAME, 
		email, 
		active, 
		activation_code
		)
		VALUES
		(NEW.login, 
		NEW.pswd, 
		NEW.name, 
		NEW.email, 
		'Y', 
		''
		);
	INSERT INTO f33.sec_users_apps 
		(login, 
		app_name
		)
		SELECT
		NEW.login,
		app_name
		FROM
		sec_apps
		;
    END */$$


DELIMITER ;

